      "summary": "Double Chocolate Mousse Squares (Rigo Jancsi) takes approximately <b>45 minutes</b> from beginning to end. For <b>$3.1 per serving</b>, you get a dessert that serves 6. One portion of this dish contains roughly <b>19g of protein</b>, <b>52g of fat</b>, and a total of <b>1138 calories</b>. It is brought to you by Foodista. 2 people have tried and liked this recipe. It can be enjoyed any time, but it is especially good for <b>valentin day</b>. If you have glaze, granulated sugar, heavy cream, and a few other ingredients on hand, you can make it. With a spoonacular <b>score of 58%</b>, this dish is good. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/rigo-jancsi-715042\">Rigo Jancsi</a>, <a href=\"https://spoonacular.com/recipes/frozen-chocolate-mousse-squares-265400\">Frozen Chocolate Mousse Squares</a>, and <a href=\"https://spoonacular.com/recipes/dark-chocolate-mousse-truffle-squares-617081\">Dark Chocolate Mousse Truffle Squares</a>.",
