      "instructions": "<ol><li>Sponge Cake</li><li>Heat the oven to 350 degrees F.</li><li>Lightly grease a jellyroll pan (10-1/2 x 15-1/2 inch pan; also called half-sheet pan) and line it with wax or parchment paper that is sprayed with baking spray.</li><li>In a medium bowl, combine the cake flour, salt, cinnamon, powdered espresso and cocoa powder.  Set this aside.</li><li>In a bowl of a standing mixer, beat the eggs for 10 minutes on high speed.  The eggs will have the consistency of soft whipped cream.   Continue beating on high speed while slowly adding the granulated sugar, one tablespoon at a time. The resulting mixture will have the appearance and consistency of a batter ready to be baked to create a sponge cake. When you lift the wire-whip from the egg mixture, the mixture should fall back to the bowl, as if it was a ribbon. That is why pastry chefs state that beat the egg mixture to a ribbon stage.</li><li>Finally, add the vanilla.</li><li>Set the standing mixer speed to its lowest setting and add the dry ingredients very slowly (i.e. like about one tablespoon at a time). Use a rubber spatula to scrape the sides of the bowl periodically and beat until just all the dry ingredients are incorporated.  Caution: over mixing will cause the eggs to deflate.</li><li>Spread the cake batter in the prepared jelly roll pan.</li><li>Bake for 12-15 minutes or until the cake starts to pull away from the sides of the pan.  Do not over bake.</li><li>Cool for a few minutes on a wire rack, then invert the cake onto a rack. Carefully remove the parchment (or wax) paper and allow the cake to cool completely.</li><li>Mousse Filling</li><li>Place the chocolate pieces in a bowl.</li><li>Bring the heavy cream to a boil on the stovetop and pour over the chocolate pieces.</li><li>Let the mixture stand for 5 minutes.</li><li>Add the rum and vanilla and stir the mixture, starting in the middle and slowly moving outward with the circular motion until you attain a smooth, shiny chocolate mousse.</li><li>Refrigerate this mixture for 2 hours</li><li>With a hand held electric mixer, whip the chilled chocolate mousse filling, scrapping the sides of the bowl with a rubber spatula, until the volume has doubled.</li><li>Whipped Cream Filling</li><li>Place the heavy cream in a cold bowl and with a hand-held electric mixer, whip up the cream to soft peaks</li><li>slowly add the sugar, 1 tablespoon at time without stopping the electric mixer.</li><li>Fold in the vanilla and refrigerate.</li><li>Note: It is also called: Chantilly Cream</li><li>Assembly:</li><li>Cut the cake in half and place one half on a large serving dish.  (Try to match the shape of the serving plate with that of the chocolate cake; in other words, do not use a circular shape serving plate, when the cake is square)</li><li>Spread the whipped chocolate mousse over the top of one half cake.</li><li>Refrigerate for one hour.</li><li>Spread the whipped cream over the chocolate mousse evenly and let it set for one hour in the refrigerator.</li><li>Place a parchment paper that is cut 1 inch larger than the cake itself, under the cake to catch the chocolate drips.</li><li>Pour the chocolate ganache over this half of the plain cake (see directions for preparation below), let it run down the sides of the cake and let it set at room temperature. (Note: if the ganache is too heavy, just warm it up either in a microwave, or with a hair dryer, blowing hot air over the surface of the ganache and it will thin-out).</li><li>Prior to placing it in the refrigerator, remove the excess ganache from the sides of the cake.</li><li>Place it in the refrigerator for a faster and more solid setting.</li><li>Once the glaze is set, cut this half cake into a cube shape, measuring either 2 X 2 or 3 X 3 inches and place it evenly on the whipped cream.</li><li>Let it set for one hour in the refrigerator.</li><li>Take the cake out of the refrigerator and slice it through, in accordance with the top slices and the cake is ready to be served.</li><li>Note: Use the serrated knife that is dipped into hot water; dip the knife as many times needed into hot water, to obtain even, smooth slices.</li><li>Glaze</li><li>Place the chocolate pieces in a medium bowl.</li><li>Bring the heavy cream to boil on the stovetop and pour the cream over the chocolate.</li><li>Let it stand for 5 minutes.</li><li>Start to mix the chocolate and cream in a circular motion, starting in the middle and slowly moving outward.</li><li>When you attain a smooth, shiny chocolate ganache, add the butter and the vanilla and stir until smooth.</li><li>Refrigerate until ready to be used.</li></ol>",
