      "instructions": "<ol><li>To prep the burgers:  In a medium bowl, toss in the ground meat, 1/2 teaspoon salt, 1/2 teaspoon pepper, and Worcestershire sauce.</li><li>Mix together with a fork.</li><li>Once the ingredients have been combined, form four patties.</li><li>To prep the red onion:  Brush olive oil on both sides of all the slices and then sprinkle with some salt and pepper.</li><li>For the lemon garlic aioli:  In a small bowl, mix all the ingredients together.</li><li>Place back in refrigerator until burgers are cooked.</li><li>To cook:  Preheat grill to around 350.</li><li>If using cast iron grates, use a paper towel or cloth to wipe all grates with canola oil.</li><li>Place burger patties on grill.</li><li>Close lid and prep the buns by brushing canola oil on insides.</li><li>After a few minutes, check the patties.  If the bottom half looks just about cooked, roughly 3 minutes, flip over, and place cheese on top.</li><li>Add red onions and buns (cut side down).</li><li>Close lid.  After another 3 or so minutes, remove everything from grill.  The cheese wont be completely melted, because of the thickness, but its okay, thats the point ;-)  The cheese will stay extra sharp if the inside isnt melted.  On the red onions, youre looking for good char marks on one side, but the onion still a bit crunchy.  For the buns, youre looking to get the bottoms nice and charred, but not so much as to make the bread tough.</li><li>To assemble the burger:  Place a handful of arugula leaves on the bottom slice of the bun.</li><li>Place burger with cheese slice on top.</li><li>Add the grilled red onions.</li><li>Slather the aioli liberally on the top half of the bun.</li></ol>",
