      "instructions": "<ol><li>Preheat toaster oven to 375. Spray baking sheet with PAM and place tenders on sheet. Baked for 10 minutes, flip at 5 minutes.</li><li>While the tenders are baking, prepare the spread by mixing all ingredients together. Set aside to let the flavors mingle and come together.</li><li>Mix together the lettuce and tomatoes. Set aside.</li><li>Just 2 minutes before the tenders are done, spread the ranch onto the tortilla. Place the warm tenders directly onto the torilla in the middle creating a row. Place the cheddar strips, pile high with lettuce and tomatoes and finally add the roasted peppers. Top with a few grinds of black pepper (to taste) and roll into a burrito-shape making sure everything stays inside. Place on a serving dish and cut in half. Enjoy!</li></ol>",
